import "./style.css";

function Jumbotron() {
    return (
        <div>
            <div className="jumbotron">
                <h1 className="display-5 text-center myText">Welcome to LookBook</h1>
                <br></br>
                <h2 className="display-6 text-center myText" style={{fontWeight: "300"}}>A React App for finding and saving your favorite books</h2>
            </div>
        </div>
    )
}

export default Jumbotron;
